import React, { Component } from 'react';

export class WorkHistory extends Component {

  render() {
    return (
        <div id="work-section">
            <div className="animation-separator">
                <hr className="line-animation-left"/>
                <h2 className="typewriter-left-work-history">Work History</h2>
            </div>
          <div>

          </div>
        </div>
    );
  }
}
